import React from 'react';

function Clickers(props)	
	{
	return(
		<div>
		{props.name}
		<button name={props.name} onClick={props.HandleClick} value ={props.amount} data-target={props.subjectsOfIncrease}> {props.name} {props.amount}</button>
		</div>


		)
}

export default Clickers;
